{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/hoangthithanhhuyen/google-analytics-course-case-study-1?scriptVersionId=191165126\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"77fd1137","metadata":{"papermill":{"duration":0.020947,"end_time":"2024-08-04T14:33:21.97654","exception":false,"start_time":"2024-08-04T14:33:21.955593","status":"completed"},"tags":[]},"source":["Hi everyone, I just completed the first case study after joining Google Data Analyst. I learned the six steps of data analysis process: Ask, Prepare, Process, Analyze, Share and Act, and applied technical tools: Google Sheet, SQL, R language and Tableau in each stage to gather information from data as well. Below is my case study using the R and Tableau."]},{"cell_type":"markdown","id":"fac4986f","metadata":{"papermill":{"duration":0.019137,"end_time":"2024-08-04T14:33:22.013884","exception":false,"start_time":"2024-08-04T14:33:21.994747","status":"completed"},"tags":[]},"source":["# Ask"]},{"cell_type":"markdown","id":"1706a213","metadata":{"papermill":{"duration":0.019281,"end_time":"2024-08-04T14:33:22.052853","exception":false,"start_time":"2024-08-04T14:33:22.033572","status":"completed"},"tags":[]},"source":["**Guiding questions **\n","\n","* What is the problem you are trying to solve? \n","\n","Determine the difference between member riders and casual riders, then encourage casual riders to become members \n","\n","* How can your insights drive business decisions? \n","\n","My insights will help marketing department creating a campaign or have another strategies to increase the number of members\n","\n","**Key task **\n","\n","* Identify the business task: Converting casual riders into annual members \n","\n","* Consider key stakeholders:\n","\n","Lily Moreno:The director of marketing and your manager \n"," \n","Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy \n","\n","Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program."]},{"cell_type":"markdown","id":"d0820895","metadata":{"papermill":{"duration":0.018593,"end_time":"2024-08-04T14:33:22.09025","exception":false,"start_time":"2024-08-04T14:33:22.071657","status":"completed"},"tags":[]},"source":["# Prepare"]},{"cell_type":"markdown","id":"c82f5d50","metadata":{"papermill":{"duration":0.01772,"end_time":"2024-08-04T14:33:22.125835","exception":false,"start_time":"2024-08-04T14:33:22.108115","status":"completed"},"tags":[]},"source":["I plan to utilize the data 2022 supplied by Motivate International Inc, accessible under this [liences](https://divvybikes.com/data-license-agreement). The data is structured in CSV files, with each file corresponding to a specific month of trip data. All files exhibit consistency in terms of columns and data types. This dataset will enable us to analyze annual members and casual riders, seeking to identify any significant characteristics related to their requirements, bike type, bike usage."]},{"cell_type":"markdown","id":"a6ae6953","metadata":{"papermill":{"duration":0.017816,"end_time":"2024-08-04T14:33:22.16135","exception":false,"start_time":"2024-08-04T14:33:22.143534","status":"completed"},"tags":[]},"source":["# Process"]},{"cell_type":"markdown","id":"a30f7ebb","metadata":{"papermill":{"duration":0.017975,"end_time":"2024-08-04T14:33:22.197699","exception":false,"start_time":"2024-08-04T14:33:22.179724","status":"completed"},"tags":[]},"source":["I choose R to analyze because the files are too large to open and use Spreadsheet. \n","\n","During this phase, I will:  \n","\n","* Combine data into a data frame  \n","\n","* Remove duplicate and NA values  \n","\n","* Remove not needed columns for analysis  \n","\n","* Add columns: ride_length and day_of_weeks \n","\n","* Remove the values less than 0 in ride_length column because duration can not be 0 or negative"]},{"cell_type":"markdown","id":"1abb4f15","metadata":{"papermill":{"duration":0.018259,"end_time":"2024-08-04T14:33:22.23416","exception":false,"start_time":"2024-08-04T14:33:22.215901","status":"completed"},"tags":[]},"source":["Plus I will use nrow() function to count rows before merger and after merger"]},{"attachments":{"df9cb4ac-caf7-49f6-a5b8-ccf43d1b5c69.png":{"image/png":""}},"cell_type":"markdown","id":"fcad3fdc","metadata":{"papermill":{"duration":0.019248,"end_time":"2024-08-04T14:33:22.271574","exception":false,"start_time":"2024-08-04T14:33:22.252326","status":"completed"},"tags":[]},"source":["![image.png](attachment:df9cb4ac-caf7-49f6-a5b8-ccf43d1b5c69.png)"]},{"cell_type":"markdown","id":"b3eac288","metadata":{"papermill":{"duration":0.018311,"end_time":"2024-08-04T14:33:22.307836","exception":false,"start_time":"2024-08-04T14:33:22.289525","status":"completed"},"tags":[]},"source":["To remove NA and duplicate values, I will check my table has NA values and duplicate or not. If it is true, using drop_na() function and distinct() to remove them"]},{"attachments":{"3e03c50b-6e00-4d4d-8f0d-10531806bb8d.png":{"image/png":""}},"cell_type":"markdown","id":"681d5819","metadata":{"papermill":{"duration":0.018426,"end_time":"2024-08-04T14:33:22.344312","exception":false,"start_time":"2024-08-04T14:33:22.325886","status":"completed"},"tags":[]},"source":["![image.png](attachment:3e03c50b-6e00-4d4d-8f0d-10531806bb8d.png)"]},{"cell_type":"markdown","id":"861ab5f9","metadata":{"papermill":{"duration":0.018314,"end_time":"2024-08-04T14:33:22.380519","exception":false,"start_time":"2024-08-04T14:33:22.362205","status":"completed"},"tags":[]},"source":["I found that my data has empty cells in column start_station. In order to avoide bias data, durty data, bad data which leads to wrong conclusion and decision, I have to remove them before analyze deeply as code below."]},{"attachments":{"8ea51815-a9b7-4ada-96fc-c751e3f36a1f.png":{"image/png":""}},"cell_type":"markdown","id":"0d634b16","metadata":{"papermill":{"duration":0.018166,"end_time":"2024-08-04T14:33:22.418039","exception":false,"start_time":"2024-08-04T14:33:22.399873","status":"completed"},"tags":[]},"source":["![image.png](attachment:8ea51815-a9b7-4ada-96fc-c751e3f36a1f.png)"]},{"attachments":{"eb03f72f-9d56-4348-bfab-6fb333cae940.png":{"image/png":""}},"cell_type":"markdown","id":"79957aa5","metadata":{"papermill":{"duration":0.018276,"end_time":"2024-08-04T14:33:22.454513","exception":false,"start_time":"2024-08-04T14:33:22.436237","status":"completed"},"tags":[]},"source":["Remove not needed columns for analysis\n","![image.png](attachment:eb03f72f-9d56-4348-bfab-6fb333cae940.png)"]},{"attachments":{"6edde978-1e92-43a8-8352-703b557aee4c.png":{"image/png":""}},"cell_type":"markdown","id":"b35bb47a","metadata":{"papermill":{"duration":0.018115,"end_time":"2024-08-04T14:33:22.49083","exception":false,"start_time":"2024-08-04T14:33:22.472715","status":"completed"},"tags":[]},"source":["To caculate the length of each ride by substracting the column “started_at” from the column “ended_at”, I will add column named ride_length to my table\n","\n","![image.png](attachment:6edde978-1e92-43a8-8352-703b557aee4c.png)"]},{"attachments":{"457ebd88-4709-44ab-94f5-629ecf9dc389.png":{"image/png":""}},"cell_type":"markdown","id":"21ad7989","metadata":{"papermill":{"duration":0.017903,"end_time":"2024-08-04T14:33:22.526509","exception":false,"start_time":"2024-08-04T14:33:22.508606","status":"completed"},"tags":[]},"source":["To understand and analyze deeply, the date column will be devide to 3 columns: day, month and hour\n","\n","![image.png](attachment:457ebd88-4709-44ab-94f5-629ecf9dc389.png)"]},{"attachments":{"38e4a674-77b7-4534-9760-09932cfa03b7.png":{"image/png":""}},"cell_type":"markdown","id":"1b8d8f89","metadata":{"papermill":{"duration":0.017888,"end_time":"2024-08-04T14:33:22.562522","exception":false,"start_time":"2024-08-04T14:33:22.544634","status":"completed"},"tags":[]},"source":["After that, I can see month column in numeric but I think it is easier to understand and it will be more clasified when creating visualization, so I will change numberic to month name.\n","![image.png](attachment:38e4a674-77b7-4534-9760-09932cfa03b7.png)\n"]},{"attachments":{"c950f144-8769-485b-8e40-93a956d45865.png":{"image/png":""}},"cell_type":"markdown","id":"feac9b6b","metadata":{"papermill":{"duration":0.017766,"end_time":"2024-08-04T14:33:22.598653","exception":false,"start_time":"2024-08-04T14:33:22.580887","status":"completed"},"tags":[]},"source":["Creating a column called “day_of_week”, and caculate the day of the week that each ride started.\n","\n","![image.png](attachment:c950f144-8769-485b-8e40-93a956d45865.png)"]},{"attachments":{"22e9bbd0-04a2-4294-86c5-efa587dbabea.png":{"image/png":""}},"cell_type":"markdown","id":"2b7c7d4e","metadata":{"papermill":{"duration":0.017995,"end_time":"2024-08-04T14:33:22.634725","exception":false,"start_time":"2024-08-04T14:33:22.61673","status":"completed"},"tags":[]},"source":["Because the trip duration can not be less than 0 or a negative number, I will remove all values < 0 in ride_length column\n","\n","![image.png](attachment:22e9bbd0-04a2-4294-86c5-efa587dbabea.png)"]},{"cell_type":"markdown","id":"6373d932","metadata":{"papermill":{"duration":0.018053,"end_time":"2024-08-04T14:33:22.671233","exception":false,"start_time":"2024-08-04T14:33:22.65318","status":"completed"},"tags":[]},"source":["# Analyze"]},{"cell_type":"markdown","id":"dc89c8fa","metadata":{"papermill":{"duration":0.018232,"end_time":"2024-08-04T14:33:22.707341","exception":false,"start_time":"2024-08-04T14:33:22.689109","status":"completed"},"tags":[]},"source":["After cleaning the data, analyzing is step 4 in Data analyst process. In this phase, I will focus on determining: \n","\n","* The usage of casuals and members  \n","\n","* The mode of day  \n","\n","* The average, max, min ride_length for users by day, month  \n","\n","* The number of riders for users by day, month  \n","\n","* The most bike type for users  \n","\n","* The most popular and the less popular start station\n","\n","Within a year, the number of riders per month let us know the month which riders have high demands. I will create 2 tables: the one is the total riders per month, and once is the total riders per month and status."]},{"attachments":{"2b1b693b-8bfe-45bb-8578-8549c91de799.png":{"image/png":""}},"cell_type":"markdown","id":"2ebef651","metadata":{"papermill":{"duration":0.017865,"end_time":"2024-08-04T14:33:22.74321","exception":false,"start_time":"2024-08-04T14:33:22.725345","status":"completed"},"tags":[]},"source":["Before analyzing deeply, I would like to know the number of users\n","\n","![image.png](attachment:2b1b693b-8bfe-45bb-8578-8549c91de799.png)"]},{"attachments":{"dd4aaef0-3ab6-4517-9643-96b28cb2f3f9.png":{"image/png":""}},"cell_type":"markdown","id":"819728fc","metadata":{"papermill":{"duration":0.017889,"end_time":"2024-08-04T14:33:22.779036","exception":false,"start_time":"2024-08-04T14:33:22.761147","status":"completed"},"tags":[]},"source":["Caculate the max, min, average ride length for users\n","\n","![image.png](attachment:dd4aaef0-3ab6-4517-9643-96b28cb2f3f9.png)"]},{"attachments":{"5630a6cc-7872-4d59-8101-8c0c9fe35037.png":{"image/png":""}},"cell_type":"markdown","id":"80514af2","metadata":{"papermill":{"duration":0.017909,"end_time":"2024-08-04T14:33:22.814986","exception":false,"start_time":"2024-08-04T14:33:22.797077","status":"completed"},"tags":[]},"source":["To know more about the ride length by day, the average ride length by day is also important, I think.\n","![Screenshot 2023-11-16 155219.png](attachment:5630a6cc-7872-4d59-8101-8c0c9fe35037.png)"]},{"cell_type":"markdown","id":"4d85dbfb","metadata":{"papermill":{"duration":0.019359,"end_time":"2024-08-04T14:33:22.852261","exception":false,"start_time":"2024-08-04T14:33:22.832902","status":"completed"},"tags":[]},"source":["The total riders per month per month and status"]},{"attachments":{"744bc3b5-f110-4e7a-bfc9-3d1f7a207894.png":{"image/png":""}},"cell_type":"markdown","id":"323ea0b5","metadata":{"papermill":{"duration":0.018679,"end_time":"2024-08-04T14:33:22.889024","exception":false,"start_time":"2024-08-04T14:33:22.870345","status":"completed"},"tags":[]},"source":["![Screenshot 2023-11-17 132858.png](attachment:744bc3b5-f110-4e7a-bfc9-3d1f7a207894.png)"]},{"attachments":{"a5ee83f1-2196-4a7f-aa85-aade4c59a053.png":{"image/png":""}},"cell_type":"markdown","id":"1d873984","metadata":{"papermill":{"duration":0.018218,"end_time":"2024-08-04T14:33:22.92508","exception":false,"start_time":"2024-08-04T14:33:22.906862","status":"completed"},"tags":[]},"source":["The mode of day_of_week\n","\n","![image.png](attachment:a5ee83f1-2196-4a7f-aa85-aade4c59a053.png)"]},{"attachments":{"b786c199-b5d7-4098-84d6-e35b5fe5c5e8.png":{"image/png":""}},"cell_type":"markdown","id":"0c247bd0","metadata":{"papermill":{"duration":0.018402,"end_time":"2024-08-04T14:33:22.961525","exception":false,"start_time":"2024-08-04T14:33:22.943123","status":"completed"},"tags":[]},"source":["Determine the most station\n","\n","![image.png](attachment:b786c199-b5d7-4098-84d6-e35b5fe5c5e8.png)\n"]},{"attachments":{"1592ce1e-13ca-4522-9d8e-f38f9d82605c.png":{"image/png":""},"d573b681-0e76-41d8-8802-26643aba05a5.png":{"image/png":""}},"cell_type":"markdown","id":"afda2f6d","metadata":{"papermill":{"duration":0.01831,"end_time":"2024-08-04T14:33:22.997928","exception":false,"start_time":"2024-08-04T14:33:22.979618","status":"completed"},"tags":[]},"source":["Determine which station casual riders used to start and the station members used to as well.\n","\n","![image.png](attachment:d573b681-0e76-41d8-8802-26643aba05a5.png) ![image.png](attachment:1592ce1e-13ca-4522-9d8e-f38f9d82605c.png)"]},{"attachments":{"1213f147-2ceb-4188-8d21-590cdf7ff1a6.png":{"image/png":""}},"cell_type":"markdown","id":"c9253e8b","metadata":{"papermill":{"duration":0.018549,"end_time":"2024-08-04T14:33:23.035185","exception":false,"start_time":"2024-08-04T14:33:23.016636","status":"completed"},"tags":[]},"source":["The favorite ride type\n","\n","![image.png](attachment:1213f147-2ceb-4188-8d21-590cdf7ff1a6.png)"]},{"cell_type":"markdown","id":"99e5eded","metadata":{"papermill":{"duration":0.018203,"end_time":"2024-08-04T14:33:23.071362","exception":false,"start_time":"2024-08-04T14:33:23.053159","status":"completed"},"tags":[]},"source":["# Share"]},{"attachments":{"3a013db3-5a01-4d4d-92bd-d5906d1fdc17.png":{"image/png":""},"475e7760-46d3-4e3d-bb88-e43f9d14235a.png":{"image/png":""},"5d12dde7-7b80-404f-a69b-97210f9a3145.png":{"image/png":""},"602702eb-031b-4693-8479-76b3738096ac.png":{"image/png":""},"6a0e25cf-7b96-4a7a-98ca-8b23aa63680b.png":{"image/png":""},"f5cdd82c-3ba8-48b8-97b5-b09d8c901c96.png":{"image/png":""},"f94ea0cc-019e-419d-9699-036aa70e340c.png":{"image/png":""}},"cell_type":"markdown","id":"fc5bb01f","metadata":{"papermill":{"duration":0.017918,"end_time":"2024-08-04T14:33:23.107224","exception":false,"start_time":"2024-08-04T14:33:23.089306","status":"completed"},"tags":[]},"source":["There are some things I found after analyzing:\n","\n","* The number of casuals (1969207 riders) is less than members (2859083 riders)\n","![image.png](attachment:6a0e25cf-7b96-4a7a-98ca-8b23aa63680b.png)\n","\n","* The average riding for casuals (23.27 mins) is higher than members (12.48 mins)\n","![image.png](attachment:3a013db3-5a01-4d4d-92bd-d5906d1fdc17.png)\n","\n","* The most popular day for rider is Saturday (779632 riders and average duration is about 40 mins) and the less is Monday. \n","![image.png](attachment:f5cdd82c-3ba8-48b8-97b5-b09d8c901c96.png)\n","\n","\n","* Casuals will use bike more on Saturday with the average of riding of approximately 26.04 mins while members will use more on Thursday with 12.07 mins average of riding\n","\n","* The popular month for users is July(710441 riders) with average ride duration of 18.85840 mins\n","![image.png](attachment:475e7760-46d3-4e3d-bb88-e43f9d14235a.png)\n","![image.png](attachment:602702eb-031b-4693-8479-76b3738096ac.png)\n","\n","\n","* The less month for users is January with only 87419 riders and 14.13786 mins average duration.\n","\n","* “Streeter Dr & Granel Eve” is the most popular station\n","\n","* Casuals often use “Streeter Dr & Granel Eve” while members use “Kingsbury St & Kinzie St”\n","\n","* Casuals use electric_bike the most while members tend to use classic_bike. \n","\n","* Otherwise, classic_bike is also the most popular bike type for users\n","![image.png](attachment:5d12dde7-7b80-404f-a69b-97210f9a3145.png)\n","\n","* Base on data, I aslo notice that users tend to use bike from 3pm to 7pm, I suppose users are almost housewives and workers.\n","![image.png](attachment:f94ea0cc-019e-419d-9699-036aa70e340c.png)\n"]},{"cell_type":"markdown","id":"e1bb1ed3","metadata":{"papermill":{"duration":0.018027,"end_time":"2024-08-04T14:33:23.14342","exception":false,"start_time":"2024-08-04T14:33:23.125393","status":"completed"},"tags":[]},"source":["\n"]},{"cell_type":"markdown","id":"8ce19f9f","metadata":{"papermill":{"duration":0.017887,"end_time":"2024-08-04T14:33:23.179054","exception":false,"start_time":"2024-08-04T14:33:23.161167","status":"completed"},"tags":[]},"source":["# Act"]},{"cell_type":"markdown","id":"8b738a5d","metadata":{"papermill":{"duration":0.01821,"end_time":"2024-08-04T14:33:23.215579","exception":false,"start_time":"2024-08-04T14:33:23.197369","status":"completed"},"tags":[]},"source":["**Conclusion**\n","There have some difference between casual and member regarding the bike type, the usage demand and the station which will bring us chances to persuade casuals to become members.\n","\n","**My recommendations**\n","* Introduce and educate the casual riders benefits when becoming members such as pricing plan, the annual memberships fee cheaper than others, so they can save amount or introduce the priorities which only members have.\n","* Create the pass for peak time and other priorities for peak month such as discount 20% for casuals when they register becoming members.\n","* In addition to single-ride tickets and fully-day passes, create monthly passes and allows them to buy monthly passes according to their needs.\n","* The number of riders is high from May to September so we should need create campaigns during this time.\n","* Run ad focus on the popular station and increase bid on popular day and at hours users active most.\n","* The class-bike is used more so maybe they are interested in health, so we can create campaign co-operating with health organization.\n","* Creating more coupons at peak time (5pm-7pm). \n","* I recommend giving discounts for the first trip to casuals if they become members.\n","\n","***Thank you for taking the time to read through my analysis. Please feel free to comment and let me know your thought***"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[],"dockerImageVersionId":30582,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":4.900722,"end_time":"2024-08-04T14:33:23.355129","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-08-04T14:33:18.454407","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}